package models;import java.util.Date;public class Marker {    private Long id;    private String description;    private MarkerType type;    private Date time;    private Date realTime;    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public String getDescription() {        return description;    }    public void setDescription(String description) {        this.description = description;    }    public MarkerType getType() {        return type;    }    public void setType(MarkerType type) {        this.type = type;    }    public Date getTime() {        return time;    }    public void setTime(Date time) {        this.time = time;    }    public Date getRealTime() {        return realTime;    }    public void setRealTime(Date realTime) {        this.realTime = realTime;    }}